
public class Other_Printing0to100withoutUsingNumber {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int init_position='a'/'a'; // a/a => 1
		int last_position='d';     // ascii value
		
		for(int i=init_position;last_position>=i;i++) {
			System.out.println(i);
		}
	}

}
